/*===================================================================================*/

$(document).ready(function() {
	
	$("a.scrollTo").click(function() {
		$("html, body").animate({
			scrollTop: $($(this).attr("href")).offset().top + "px"
		}, {
			duration: 1000,
			easing: "easeInOutCubic"
		});
		return false;
	});
	
});


